### English Title:
Kuwait's Supreme Committee Decides to Withdraw Citizenship from 962 Individuals

### English Text Summary:
The Kuwaiti Supreme Committee for Citizenship has decided to revoke the citizenship of 962 individuals for various reasons, as announced by the Ministry of Interior. The decisions include 13 cases of dual nationality, 186 cases of fraud and false statements, and 82 additional cases of similar offenses. Furthermore, 681 individuals had their citizenship withdrawn for reasons related to the "higher interest of the country" or "great services." These decisions were made during a meeting chaired by the Acting Prime Minister and Minister of Interior, Sheikh Fahd Yusuf Saud Al-Sabah.

